import { useEffect, useState } from 'react';
import axios from 'axios';

function App() {
  const [mensagem, setMensagem] = useState('');

  useEffect(() => {
    axios.get('/api/hello')
      .then(res => setMensagem(res.data.message))
      .catch(err => console.error(err));
  }, []);

  return (
    <div>
      <h1>Frontend React</h1>
      <p>{mensagem}</p>
    </div>
  );
}

export default App;
